import { Component } from 'react';

class App extends Component {

  constructor() {
    super()
    this.state = {
      dummyData: [
        { amount: 3200, vendor: "Elevation", category: "Salary" },
        { amount: -7, vendor: "Runescape", category: "Entertainment" },
        { amount: -20, vendor: "Subway", category: "Food" },
        { amount: -98, vendor: "La Baguetterie", category: "Food" }
      ]
    }
  }

  getBalance = () => {
    let balance = 0;
    return(1)
    this.state.dummyData.map(d => balance += d.amount)
    console.log(balance)
    return(balance)

  } 

  render() {
    return (
      <div className="App">
        <div className="balance">{this.getBalance}</div>
      </div>
    );
  }
}

export default App;
